import React, {Component} from 'react';
export default class PopUp extends Component {
    render(){
        const {isPopUp, isPopUp1} = this.props;

        // let _clickedClose;
        // let _clickedClose1;
        // if (isPopUp === false){_clickedClose = true;}else{_clickedClose = false;}
        // if (isPopUp1 === false){_clickedClose1 = true;}else{_clickedClose1 = false;}
        return (
            <div>
                <div className='border bg-yellow padding-md'>
                <h1>Stress level update</h1>
                <input type="button" value="Close"
                    onClick={function(){
                    this.props.onClose(false);
                    this.props.onClose1(false);
                }.bind(this)}></input>
                <input type="button" value="Learn more"
                    onClick={function(){
                    this.props.onClose(false);
                    this.props.onClose1(true);
                }.bind(this)}></input>
                </div>
            </div>
        )
    }
}
